import React from "react";
import { Box, Container, Typography, Grid, Paper } from "@mui/material";
import { keyframes } from "@mui/system";
import Footer from "../Footer/Footer";

// Simple fade-in animation
const fadeIn = keyframes`
  from { opacity: 0; transform: translateY(20px); }
  to { opacity: 1; transform: translateY(0); }
`;

const About = () => {
  return (
    <Box style={{ minHeight: "100vh", padding: "40px 0", backgroundColor: "#f1f5f9" }}>
      <Container style={{ maxWidth: "900px" }}>
        {/* Page Header */}
        <Box
          style={{
            textAlign: "center",
            marginBottom: "40px",
            animation: `${fadeIn} 1s ease-in`,
          }}
        >
          <Typography
            variant="h3"
            style={{
              fontWeight: "bold",
              color: "#1a3c34",
              marginBottom: "10px",
              fontSize: "2.5rem",
            }}
          >
            About Landora
          </Typography>
          <Typography
            variant="h6"
            style={{
              color: "#4a5568",
              fontSize: "1.2rem",
              fontWeight: "400",
              lineHeight: "1.6",
            }}
          >
            Your trusted platform for property management and exploration.
          </Typography>
        </Box>

        {/* Our Story */}
        <Box style={{ marginBottom: "40px", animation: `${fadeIn} 1.2s ease-in` }}>
          <Typography
            variant="h5"
            style={{
              fontWeight: "600",
              color: "#2d3748",
              marginBottom: "15px",
              fontSize: "1.8rem",
            }}
          >
            Our Story
          </Typography>
          <Typography
            variant="body1"
            style={{
              color: "#4a5568",
              lineHeight: "1.8",
              fontSize: "1rem",
            }}
          >
            Landora was founded with a passion to revolutionize property management. Our platform leverages cutting-edge technology to simplify the complexities of managing, buying, and exploring properties. Whether you're a property owner, manager, or buyer, Landora offers intuitive tools to make your journey seamless and efficient.
          </Typography>
        </Box>

        {/* Mission and Vision */}
        <Grid container spacing={4} style={{ marginBottom: "40px" }}>
          <Grid item xs={12} md={6}>
            <Paper
              style={{
                padding: "24px",
                borderRadius: "12px",
                backgroundColor: "#ffffff",
                boxShadow: "0 4px 12px rgba(0, 0, 0, 0.1)",
                animation: `${fadeIn} 1.4s ease-in`,
                transition: "transform 0.3s ease",
              }}
              onMouseOver={(e) => (e.currentTarget.style.transform = "translateY(-10px)")}
              onMouseOut={(e) => (e.currentTarget.style.transform = "translateY(0)")}
            >
              <Typography
                variant="h6"
                style={{
                  fontWeight: "600",
                  color: "#2d3748",
                  marginBottom: "10px",
                  fontSize: "1.25rem",
                }}
              >
                Our Mission
              </Typography>
              <Typography
                variant="body1"
                style={{
                  color: "#4a5568",
                  lineHeight: "1.6",
                  fontSize: "1rem",
                }}
              >
                To empower property owners and buyers with a seamless, reliable, and innovative platform that streamlines property management and decision-making processes.
              </Typography>
            </Paper>
          </Grid>
          <Grid item xs={12} md={6}>
            <Paper
              style={{
                padding: "24px",
                borderRadius: "12px",
                backgroundColor: "#ffffff",
                boxShadow: "0 4px 12px rgba(0, 0, 0, 0.1)",
                animation: `${fadeIn} 1.6s ease-in`,
                transition: "transform 0.3s ease",
              }}
              onMouseOver={(e) => (e.currentTarget.style.transform = "translateY(-10px)")}
              onMouseOut={(e) => (e.currentTarget.style.transform = "translateY(0)")}
            >
              <Typography
                variant="h6"
                style={{
                  fontWeight: "600",
                  color: "#2d3748",
                  marginBottom: "10px",
                  fontSize: "1.25rem",
                }}
              >
                Our Vision
              </Typography>
              <Typography
                variant="body1"
                style={{
                  color: "#4a5568",
                  lineHeight: "1.6",
                  fontSize: "1rem",
                }}
              >
                To redefine property management by connecting users with their ideal properties through a secure, user-friendly, and innovative platform trusted worldwide.
              </Typography>
            </Paper>
          </Grid>
        </Grid>

        {/* Key Features */}
        <Box style={{ animation: `${fadeIn} 1.8s ease-in`, marginBottom: "40px" }}>
          <Typography
            variant="h5"
            style={{
              fontWeight: "600",
              color: "#2d3748",
              marginBottom: "20px",
              fontSize: "1.8rem",
            }}
          >
            Key Features
          </Typography>
          <Grid container spacing={3}>
            {[
              "Effortlessly manage multiple properties with intuitive tools",
              "Explore verified listings with comprehensive details and images",
              "Monitor property availability and status in real-time",
              "Secure platform with encrypted transactions and data protection",
            ].map((feature, index) => (
              <Grid item xs={12} md={6} key={index}>
                <Paper
                  style={{
                    padding: "16px",
                    borderRadius: "8px",
                    backgroundColor: "#ffffff",
                    boxShadow: "0 2px 8px rgba(0, 0, 0, 0.08)",
                    transition: "transform 0.3s ease, box-shadow 0.3s ease",
                  }}
                  onMouseOver={(e) => {
                    e.currentTarget.style.transform = "translateY(-5px)";
                    e.currentTarget.style.boxShadow = "0 4px 12px rgba(0, 0, 0, 0.15)";
                  }}
                  onMouseOut={(e) => {
                    e.currentTarget.style.transform = "translateY(0)";
                    e.currentTarget.style.boxShadow = "0 2px 8px rgba(0, 0, 0, 0.08)";
                  }}
                >
                  <Typography
                    style={{
                      color: "#4a5568",
                      fontSize: "1rem",
                      lineHeight: "1.6",
                    }}
                  >
                    {feature}
                  </Typography>
                </Paper>
              </Grid>
            ))}
          </Grid>
        </Box>
      </Container>
      <Footer />
    </Box>
  );
};

export default About;
